import React, { Component } from 'react'

import Heading from '../components/heading';
import Button from '../components/button';

import '../assets/addCodePage.css'

export class addCodePage extends Component {
    render() {
        return (
            <div>
                <Heading />
                <p className="paraStyle">Drop an image or click to browse</p>

                <input type="file" name="file" id="file" className="inputfile" />
                <label for="file"><i className="fas fa-file-image-o" aria-hidden="true"></i></label>

                <label className="labelStyle">Or enter the image URL: </label>
                <input className="inputStyle" type="text"></input>                

                <Button name="Crop Image"></Button>
                <Button name="Upload"></Button>
            </div>
        )
    }
}

export default addCodePage
